 import config from '../Config/appsetting';
 const headers = {
    Authorization: "Basic dHJpZXVwdjpwaGFtdHJpZXU=",
  };

  const GetConfigLogin = (username,password) => {
    return {
        params: {
          appid: config.appid,
          username,
          password,
          deviceinfo: "",
        },
        headers
      };
}
export default {
    GetConfigLogin:(username,password)=>{
        return GetConfigLogin(username,password)
    },
    headers
}
